import "./intro.scss"

export default function Intro() {
    return (
        <div className="intro" id="intro">
         <div className="left">
            <div className="imageContainer">
                <img src="images/profile.jpg"></img>
            </div> 
         </div>
         <div className="right"></div>
            
        </div>
    )
}
